import React from 'react';
import FormComponent from '../../components/form.component';

export default class CreateVisiteComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            visitesList: [{
                enterprise: "Carrefour",
                date: new Date(),
                id: "19920a3dd"
            },
            {
                enterprise: "Leclerc",
                date: new Date(),
                id: "127226rf3"
            },
            {
                enterprise: "Auchan",
                date: new Date(),
                id: "127236rdz2"
            }]
        }
    }
    render() {
        let forms = [
            [
                { type: 'input', label: 'Entreprise', placeholder: 'Entreprise', name: 'enterprise' },
                { type: 'input', label: 'Siret', placeholder: 'Siret', name: 'siret' }
            ],
            { type: 'input', label: 'Adresse', placeholder: 'Adresse', name: 'adress' },
            {
                type: 'select', label: 'Action associées', placeholder: 'Action', name: 'actions',
                options: [{ key: "1244", text: "Action 1", value: 1 }, { key: "12444", text: "Action 2", value: 2 }]
            },

        ]
        return (
            <FormComponent onSubmit={(data) => console.log(data)} submitButtonText="Valider" forms={forms} />
        );
    }
}
